Step-by-step reasoning

**Key Psychological Mechanisms in Proposer Behavior:**

1. **Fairness Considerations:** Proposers consider not just their own payoff but what is “fair” given the relative contributions (i.e., tokens found by themselves and the opponent).
2. **Self-Interest vs. Fairness:** There is a tradeoff between maximizing one’s own share (self-interest) and making an offer that the other party may find fair (risk aversion to rejection, but you said to focus on prediction not acceptance).
3. **Contribution-Based Fairness Reference:** Explicit quantities “token_self” and “token_opp” mean proposers may anchor “fairness” as a proportional (or equal) split according to contribution.
4. **Individual Variability:** Each person may have their own tendency towards generosity or fairness sensitivity.
5. **Noise:** Behavioral data typically has trial-level variability/noise.

**Mechanism Interactions:**

- The “ideal” proposed percentage for the opponent is likely anchored to the “contribution percentage” (i.e., what % of tokens the opponent found). Proposers may adhere more or less tightly to this norm, or offer less/more based on their own bias.
- Some may consistently propose slightly less or more than “contribution fairness” (captured by personal bias).
- Magnitude effects (e.g., endowment size) are possible but not necessary unless data show otherwise.

**Mathematical Formulation Possibilities:**

- **Reference point:**  
  reference_perc = 100 * token_opp / (token_opp + token_self)  
  (This is the percentage “fair share” for opponent.)
- **Offer generation:**
  proposed_perc = w * reference_perc + bias + noise
  (w ~ adherence to reference fairness; bias ~ idiosyncratic generosity/greed/additional base tendency.)

**Parameter Selection and Covariance:**

- With only w and bias, these are minimally covariant because:
  - w scales the reference (e.g., w < 1 = undercut, w > 1 = over offer)
  - bias shifts the offer up/down independently of the reference
- Adding more (e.g., quadratic or interaction terms) would introduce more covariance and is not warranted given only 14 data points per subject for proposals.
- Noise is naturally not a learnable parameter.

**Mapping to Observable Variables:**

- proposed_perc is in the data precisely when trial_role == 2.
- All needed inputs (token_self, token_opp) are available per trial.

**Model Decision:**

- **Three free parameters:** (1) fairness adherence weight (w), (2) additive bias, and (3) standard deviation (noise, for recovery and fit).
- Bias bounds: generous but realistic (say -50 to 50).  
  w bounds: generous, say [0,2] (so people could double the fairness anchor or halve it).  
  Noise: non-negative, reasonable max (say 0 to 30).

