Let i index trials where trial_role == 2 (participant is proposer).

Let  
reference_perc_i = 100 * token_opp_i / (token_opp_i + token_self_i)  
proposed_perc_i = w * reference_perc_i + bias + ε_i

with ε_i ~ Normal(0, sigma)

